import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import IconButton from '@mui/material/IconButton';
import MenuIcon from '@mui/icons-material/Menu';
import { Link } from 'react-router-dom'

export default function Appbar() {
  const myStyle={
    backgroundImage:"url('https://flevix.com/wp-content/uploads/2019/12/Live-Background-1.svg')",
    height: '100vh',
    marginTop: '0px',
    backgroundSize: 'cover',
    backgroundRepeat: 'noRepeat'
  }

  return (
    <Box sx={{ flexGrow: 1 }}>
      <AppBar style={myStyle} position="static">
        <Toolbar>
          <IconButton
            size="large"
            edge="start"
            color="inherit"
            aria-label="menu"
            sx={{ mr: 2 }}
          >
            <Link to="/sitemap" style={{color: '#FFF'}}>
              <MenuIcon />
            </Link>
          </IconButton>
          <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
            <Link to="/" style={{color: '#FFF', textDecoration: 'none'}}>RTT Forms</Link>
          </Typography>
          <Link to="/login" style={{color: '#FFF', textDecoration:'none' }}>
            <Button color="inherit">Sign Up</Button>
          </Link>
        </Toolbar>
      </AppBar>
    </Box>
  );
}
